import (
	context "context"
	rapiddocs "github.com/multi-line-docs/rapiddocs"
	rapiddocsclient "github.com/multi-line-docs/rapiddocs/client"
)

client := rapiddocsclient.NewClient()
response, err := client.User.CreateUser(
	context.TODO(),
	&rapiddocs.CreateUserRequest{
		Name: "name",
		Age: rapiddocs.Int(
			1,
		),
	},
)

